// import React from 'react';
// import {useNavigate} from "react-router-dom"

// const Project = () => {
//   const navigate = useNavigate();

//   return (
//   <>
//      <h1>PROJECT NAME</h1>
//      <button onClick={()=>navigate(-1)}>Go Back Home</button>
//   </>
//   )
// };

// export default Project;

import React from "react";
import { useNavigate } from "react-router-dom";
import Carousel from "react-bootstrap/Carousel";

function UncontrolledExample() {
  const navigate = useNavigate();
  return (
    <>
    <Carousel>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://raw.githubusercontent.com/umairshah14/README-Generator/main/assets/images/Screenshot%202023-02-20%20at%2016.31.00.png"
          alt="First slide"
        />
        <Carousel.Caption>
          <h3>README Generator</h3>
          <p>Generate a readme file through a series of terminal questions</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
    <button onClick={() => navigate(-1)}>Go back to all projects</button>
    </>
  );
}
import Card from 'react-bootstrap/Card';

function ImageAndTextExample() {
  return (
    <>
      <Card>
        <Card.Body>
          <Card.Text>
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
        </Card.Body>
        <Card.Img variant="bottom" src="https://raw.githubusercontent.com/umairshah14/README-Generator/main/assets/images/Screenshot%202023-02-20%20at%2016.31.00.png" />
      </Card>
    </>
  );
}

export default ImageAndTextExample;
// export default UncontrolledExample;
